import React, { Component } from "react";

class Second extends Component {
  render() {
    return (
      <>
        <section class="second-hightlight-wrapper">
          <div class="container">
            <div class="new-alert">{this.props.new}</div>

            <div class="title-wraper bold black"> {this.props.name} </div>

            <div class="description-wrapper black">
              {this.props.description}
            </div>

            <div class="price-wrapper grey">{this.props.price}</div>

            <div class="links-wrapper">
              <ul>
                <li>
                  <a href="">Learn more</a>
                </li>
                <li>
                  <a href="">Buy</a>
                </li>
              </ul>
            </div>
          </div>
        </section>
      </>
    );
  }
}

export default Second;
